Es waren nämlich drei Stockwerke, die aber keine Säulen hatten, wie die Säulen der Vorhöfe waren. Deshalb sprangen sie von dem untern und mittlern Stocke aus vom Boden um fünfzig Ellen vor.
Die äußere Mauer an den Gemächern, die in der Richtung gegen den äußern Vorhof vor den Gemächern lagen, hatte eine Länge von fünfzig Ellen;
denn die Länge der Gemächer des äußern Vorhofes betrug fünfzig Ellen und die Länge an der Vorderseite des Tempels hundert Ellen.
